INSERT INTO `event_infos` VALUES (1,1,NULL,NULL,NULL,NULL,NULL,NULL,'The countdown begins to the 2020 PPC Marathon on April 4. It is set to be another memorable experience in one of Zimbabwe\'s magical wonders.\r\n\r\nThe race starts at the centre of the Matopos National Park and takes a gruelling 53km course ending at the Bulawayo Athletic Club and incorporates a 21,1km half marathon, 10km and 5km fun runs on the same route  Are you ready Zimbabwe? #PPCMarathon2020 #StrengthBeyond',NULL,1,'img/slide/ppc_marathon.png','img/slide/mobile/ppc_marathon_mobile.jpg','img/slide/card-image/ppc_marathon_card.png','img/slide/ticket-img/ppc_marathon.jpg',NULL,'https://www.facebook.com/ppczimbabwe/','https://twitter.com/ppczimbabwe',NULL,NULL,'https://ppc.africa/zimbabwe',NULL,NULL),(2,2,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om.jpg',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,3,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om1.jpg',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,4,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om.jpg',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,5,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om.jpg',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,6,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om1.jpg',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,7,NULL,NULL,NULL,NULL,NULL,NULL,'COMING SOON',NULL,1,'img/slide/om.jpg',NULL,NULL,'',NULL,'https://www.instagram.com/','https://www.twitter.com/',NULL,NULL,NULL,NULL,NULL),(8,8,NULL,NULL,NULL,NULL,NULL,NULL,'The 25th April is set as thee frivolous day of high tea, games, fashion show and wonderful prizes to be won as the Jewelry Auction takes off. Hosted at the Meikles Hotel you know the service is exceptional.  So, all you need to bring along is your finesse, elegance and exceptionally good company, for a relaxing afternoon of delicacies. The event begins at 2:00 pm, in the Palm court and parking is included in the ticket.',NULL,1,'img/slide/high_tea.png',NULL,'img/slide/card-image/high_tea.png','img/slide/ticket-img/high_tea_ticket.png',NULL,NULL,NULL,NULL,'0774361648',NULL,NULL,NULL);
